import React from 'react';
import {View} from 'react-native'
import { TouchableOpacity } from 'react-native-web';

function Header(props) {
    return (
        <TouchableOpacity style={{
            height: 80,
            backgroundColor:'red',
            alignItems:'center',
        }}>
        
           <View style={{
               width:'80%',
               margin:10,
               marginTop:30,
               height:40,
               borderRadius:25,
               borderColor:'#808080',
               backgroundColor:'white',
               alignItems:'center',
           }}>

           </View> 
        </TouchableOpacity>
    );
}

export default Header;
